    const history = useHistory();
    const {register, handleSubmit, errors} = useForm();
    const onSubmit = data=> {
        history.push(props.path)
    }
    return(
    <form onSubmit={handleSubmit(onSubmit)}>
        <input type="text" placeholder='Email' ref={register} />
        <input type="submit"/>
    </form>   
    
    )

}

export default MyButton
